Explicación: Este soneto es obra del poeta, periodista y político hispanoamericano José Joaquín de Mora, quien vivió entre 1783 y 1864, por lo tanto, perteneciente al siglo XIX. Es un poema satírico que critica de manera irónica el comportamiento de los liberales de su época.
